        private static bool CheckIfFormingMagicSquare(List<List<int>> s)
        {
            int sumRow = 0,
            sumCol = 0,
            sumDiagDer = 0,
            sumDiagIzq = 0;

            for (int i = 0; i < 3; i++)
            {
                for (int j = 0; j < 3; j++)
                {
                    sumRow += s[i][j];
                    sumCol += s[j][i];

                    if (i == j)
                    {
                        sumDiagDer += s[i][i];
                        sumDiagIzq += s[i][2 - i];
                    }
                }

                if (sumRow != 15 || sumCol != 15)
                    return false;

                sumRow = 0;
                sumCol = 0;
            }

            if (sumDiagDer != 15 || sumDiagIzq != 15)
                return false;

            return true;
        }
