        public static int birthday(List<int> s, int d, int m)
        {
            int result = 0;
            int sumContiguous = 0;

            int index = 0;

            while (index < s.Count)
            {
                for (int i = index; i < index + m && i < s.Count; i++)
                {
                    if (s[i] + sumContiguous <= d)
                    {
                        sumContiguous += s[i];

                        if (sumContiguous == d && i == index + m - 1)
                        {

                            // index = i;
                            result++;
                            break;
                        }
                    }
                    else
                    {

                        break;
                    }
                }

                sumContiguous = 0;
                index++;
            }

            return result;

        }

