        private static int GetCountOfFruitsInHouse(List<int> fruits, int s, int t, int b)
        {
            int distance = 0;
            int count = 0;

            for (int i = 0; i < fruits.Count; i++)
            {
                distance = b + fruits[i];
                if (distance >= s && distance <= t)
                {
                    count++;
                }
            }

            return count;
